import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Homepage from './homepage.js';
import icon from './icon.png';
import me from './me.jpg';
import './App.css';
//import logo from './logo.svg';

class AboutMe extends Component {

  render() {
  return (
    <div>
      <div>
        <Link to='/' style={{textDecoration: "none"}}>
          <img src={icon} style={{height: '125px', bottom: '20px', marginTop: '10px', zIndex: '2'}}></img>
        </Link>
        </div>
        <div style={{alignItems: 'left'}}>
        <img className="Photo" src={me} style={{height: '400px', bottom: '20px', marginTop: '10px', zIndex: '2', borderWidth: '20px', borderColor: '#000000'}}></img>

        <div style={{backgroundColor: '#ff0d4d'}}>
            <h3>Julia Opatrny</h3>
            <h5 style={{marginTop: '-20px'}}>jsopatrny@gmail.com</h5>
            <h5 style={{marginTop: '-25px'}}>(917)208-2775</h5>
            <p style={{marginTop: '-10px'}}>I am based in NYC</p>
          </div>
        </div>
    </div>
  );
  }
}


export default AboutMe;
